INSERT INTO `dxs_company` VALUES ('145865134046866', '全国大学生创业就业中心', '全国大学生创业就业中心（以下简称“中心”）于2014年11月18日正式成立。中心是由北京鸿鑫国际集团有限公司（以下简称“鸿鑫国际”）旗下的全资子公司北京鸿鑫国际教育科技发展有限公司（以下简称“鸿鑫教育”）主办，鸿鑫教育联合鸿鑫国际、北京鸿鑫创想科技有限公司、北京鸿鑫睿智人力资源有限公司及北京鸿鑫盛世文化传媒有限公司等知名企业，充分利用互联网及移动互联技术，以及整合全国高校毕业生创业就业系统资源，建立全国高校毕业生创业就业联盟，采取线上、线下相结合的方式服务于中心下设的四个中心。  全国大学生就业创业中心主要分为：创业中心、就业中心、活动中心、培训中心四个部分。  创业中心：努力从根本上解决当代大学生创业实训、创业孵化（鸿鑫商城线下2016年100家中高档社区超市实体直营店）创业项目、创业基地、创业基金等资源的支持与帮扶。  就业中心：努力从根本上解决当代大学生就业上岗、实习实训、社会实践认知活动（勤工俭学）供求信息不对称等问题；  活动中心：努力让当代大学生参与到更多的社会活动，夏令营（冬令营）、出国游学（美洲、欧洲及东南亚）、名企参观、名师巡讲（成功企业家俱乐部中各行业的商业领袖级的企业家走进大学校园）、创业大赛（鸿鑫商城社区超市、校园直购库、社区酒庄以及社区服务项目的创业者）；  培训中心：创业培训、实训培训、就业培训、大学生职业规划、职业教育培训。  中心将主要围绕大学生创业及毕业生就业需要，充分发挥教育行业资源优势，开展多种服务，同时还设立：在线应征入伍、边区支教、志愿者西部建设、公务员招聘、大学生村官、三支一扶等公共资源栏目。辅助或带动各省市、行业、高校提升大学生的创业、就业服务与指导水平。  本中心的基本定位为由鸿鑫教育（企业）主办，以市场需求为导向，以具有示范带动作用、行业特色鲜明服务于当代大学生创业就业为主要的公共服务平台。其最终建设目标是集当代大学生创业规划与扶持（创业培训与指导、创业实训）、创业项目的筛选、项目立项、项目资金投入、项目市场运营及大学毕业生的就业双向选择、网络招聘、远程面试、信息咨询、指导培训、政策发布、在线测评（素质测评、个性测评、兴趣测评、职业测评）等功能为一体的综合型示范性的一个高水平、全天候、多功能、广覆盖、高效率的创业就业服务平台。  2016年大学生创业就业中心将为全国大学生创设600个实体的创业岗位：建立“鸿鑫商城”的线下社区100家实体直营店，建立“鸿鑫商城——校园直购”线下“校园直购库”的服务体系，在全国各个大学里建立“大学生勤工俭学中心”，2016年计划在全国帮助至少3000名大学生参与社会实践活动（勤工俭学），为当代大学生实实在在的做好创业、就业服务工作。', '010-64823038   64823866   64823768   82122329', '400-122-6989', 'csee@hongxinguoji.com', '中国 北京市 朝阳区 惠新东街  紫光发展大厦  A座三层', 'Copyright © 2016 by 鸿鑫国际集团 all rights reserved', '京ICP备16013353号-2', 'sec-china', 'www.sec-hxi.com', 'www.hongxinchuanmei.xom', 'www.hongxinguoji.com', '中国 北京市朝阳区惠新东街  紫光发展大厦  A座三层', '');
