INSERT INTO `dxs_training_article` VALUES ('2', '8', '实习实训1', null, '2016-06-23 09:55:26', null, '阿拉卡减肥的考虑将诶就付款啦就是圣诞节覅恩瓦附近拉数据分开的地方金额非拉大家反馈开始的加拉解解乏拉斯克奖的刷卡机返利金额开了房间爱说话', null, null, null, '0');
INSERT INTO `dxs_training_article` VALUES ('3', '8', '实习实训2', null, '2016-05-31 09:55:30', null, '付款了时间放可乐鸡电视剧佛IE及福利卡时间离开的就是伐啦接近疯狂拉升打死了付款了经费落实贷款及付款啦打什么考虑你肯定积分卡拉斯加分的伤口就覅科技房间辣的减肥了沙龙飞机来决定是否记得看圣诞节福利就撒开房间爱死了就放到了深刻', null, null, null, '0');
INSERT INTO `dxs_training_article` VALUES ('4', '8', '实习实训3', null, '2016-06-14 09:55:34', null, '诶URI哦爱哦流口水的减肥了传，吗，圣诞节看房了解诶打开了手机啊覅揭开了都快死垃圾分类看酒店顺利开飞机上的快点撒垃圾分类看的撒加分了空间都是速度可垃圾分类的伤口就发来看等级分类的会计师斯科拉及地方拉低就', null, null, null, '0');
INSERT INTO `dxs_training_article` VALUES ('5', '7', '创业培训2', null, '2016-06-16 09:55:37', null, '广泛的三个人广泛的三个人根深蒂固事故发生的故事大概山东分公司的股份受到广泛受到分公司的都十分广泛的三国杀但是公司发反反复复飞公司打工地方试试事实上事实上公司', null, null, null, '0');
